import React from 'react';
import catgirl from './Gay-Cat.png'

import './App.css';
class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {headpat: 0,count: 0};
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <div align="center">
            Gay Catgirl on screen for {this.state.count} seconds <br/>
            Click her to give headpats! Headpats Given {this.state.headpat}
          </div>
          <div align="center" onClick={this.test()}> <img src={catgirl} alt="Gay Cat"/></div>
        </header>
      </div>
    );
  }
  test(){
    this.setState({headpat: this.state.headpat++});
  }
  tick(){
    this.setState({count: this.state.count++});;
  }
}
setInterval(App.tick, 1000);
export default App;
